import React, { Component } from 'react';
import "bulma/css/bulma.css";
import './Navbar.css';
import Github from '../Images/github_logo.png'
import LinkedIn from '../Images/linkedin_logo.png'

// const [isActive, setActive] = React.useState(false);

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isActive: false
    };
  }

  verifyCalendar = () => {
    if (this.state.availability !== null) {
      return (
        <div className="Cal-check">
          <div className="check">
            <Image src={Checkmark} height={50} width={50} />
          </div>
        </div>
      );
    }
  };

  render() {
    return (
    <div>
    <nav className="navbar" role="navigation" aria-label="main navigation">
      <div className="navbar-brand">
        <div className="navbar-item">
          <div className="my_Label">
            Brendan Muldowney
          </div>
        </div>
        <a onClick={() => this.responsiveNavbar()} role="button" className={"navbar-burger burger" + (this.state.isActive ? 'is-active' : '') }
           aria-label="menu" aria-expanded="false" data-target="navbarBasicExample">
          <span aria-hidden="true"></span>
          <span aria-hidden="true"></span>
          <span aria-hidden="true"></span>
        </a>
      </div>

      <div id="navbarBasicExample" className={'navbar-menu ${this.state.isActive ? "is-active" : ""}'}>
        <div className="navbar-start">
          <a className="navbar-item">
            About
          </a>
          <a className="navbar-item">
            Resume
          </a>
          <a className="navbar-item">
            Projects
          </a>
          <a className="navbar-item">
            Contact
          </a>
        </div>

        <div className="navbar-end">
          <div className="navbar-item">
            <div className="buttons">
              <a className="button is-link is-outlined">
                <img src={Github} width="30" height="30"/>
              </a>
              <a className="button is-link is-outlined">
                <img src={LinkedIn} width="30" height="30"/>
              </a>
            </div>
          </div>
          <div className="navbar-item">
          <div className = "navbar_Spacing">
          test
          </div>
          </div>
        </div>
      </div>
    </nav>
    {this.state.isActive}
    </div>
    );
  }
}

export default Navbar;
